import React, { Component } from 'react';

class Directory extends Component {
    constructor(props) {
        super(props)

        this.state = {
            ListOfGenres: [
                'Action',
                'Novel',
                'Fantasy',
                'Non-fiction'
            ]
        }
    }

    render() {
        let { ListOfGenres } = this.state;
        let list = ListOfGenres.map(genre => <div>{genre}</div>)
        return (

            list
        )
    }
}

export default Directory;
